import base64

# 12306点击图片验证的本质：就是通过发送图片所处的坐标去后台验证的
# 第一种取验证码图片方式，就是解码base64加密方式
# 中间的加密字符串是不会变的
'data:image/jpg;base64,'

pic_str = ''

pic_decode = base64.b64decode(pic_str)
# print(pic_decode)
with open('code.png','wb')as fp:
    fp.write(pic_decode)

